(1, '651832b8c3a22', NULL, 'Advanced WooCommerce Support', 'We have detected you are running WooCommerce. Upgrade to AIOSEO Pro to unlock our advanced eCommerce SEO features, including SEO for Product Categories and more.', 'info', '[\"all\"]', NULL, 'woo-upsell', '2023-09-30 14:37:44', NULL, 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=woo-notification-upsell', NULL, NULL, 0, 0, '2023-09-30 14:37:44', '2023-09-30 14:37:44'),
(2, '652ff91039ad9', NULL, 'Elevate Your SEO Strategy: Meet Cornerstone Content in AIOSEO 4.4.8! 🚀🔥', 'Introducing Cornerstone Content – your secret weapon to boost search rankings and dominate your niche. 🏆\r\n<br><br>\r\nBuild <em>authority & expertise</em>, improve <em>crawling and indexing</em>, supercharge your <em>semantic SEO</em>, and more with this game-changing addition in <strong>AIOSEO 4.4.8</strong>.\r\n<br><br>\r\n👇🏻👇🏻 Upgrade today or click to Learn more!\r\n', 'success', '[\"4-x\",\"lite\"]', 860, NULL, '2023-11-25 04:17:13', NULL, 'Learn More', 'https://aioseo.com/new-supercharge-your-seo-and-content-strategy-with-cornerstone-content/?utm_source=WordPress&utm_campaign=cornerstone-content-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=cornerstone-content-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-10-18 15:26:08', '2023-12-05 17:39:23'),
(3, '652ff9103be60', NULL, '[New] TruSEO Highlighter: Instantly locate readability issues! 😮', 'On-page SEO just got easier with our new TruSEO Highlighter! 😮 Turn on the highlighter to instantly find readability issues on a page. 🥳\r\n<br><br>\r\nThis is our most requested feature! With TruSEO highlighter, you’ll instantly find readability issues flagged by AIOSEO.\r\n<br><br>\r\nUpdate to <strong>AIOSEO 4.4.6 TODAY</strong> to simplify SEO & get traction.', 'success', '[\"4-x\",\"lite\"]', 848, NULL, '2023-11-25 04:17:13', NULL, 'Learn More', 'https://aioseo.com/announcing-truseo-highlighter/?utm_source=WordPress&utm_campaign=truseo-highlighter-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=truseo-highlighter-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-10-18 15:26:08', '2023-12-05 17:39:23'),
(4, '652ff9103d933', NULL, '[New] Improved Crawling and Indexing with AIOSEO 4.4.4 🚀', 'Improve your site’s crawlability and indexability with our improved robots.txt editor. With new directives and advanced functionality, ranking your site on search engines just became easier.\r\n<br><br>\r\nWe’ve also added many more new features to version 4.4.4 of AIOSEO. Check out our announcement for more information.\r\n<br><br>\r\nUpgrade to AIOSEO 4.4.4 today!', 'success', '[\"4-x\",\"lite\"]', 832, NULL, '2023-11-25 04:17:13', NULL, 'Learn More', 'https://aioseo.com/greater-robots-txt-file-customization-for-improved-crawlability/?utm_source=WordPress&utm_campaign=robots-editor-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=robots-editor-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-10-18 15:26:08', '2023-12-05 17:39:23'),
(5, '652ff9103ea69', NULL, 'NEW: Announcing the AIOSEO Analyzer Chrome extension!  🚀', 'Speed up content reviews and technical SEO checks. This new free tool is designed for you!\r\n<br><br>\r\nAIOSEO Analyzer gives you a big-picture view of your SEO, bringing problem areas into sharp focus. It works on both unpublished <em>and</em> published pages.\r\n<br><br>\r\nAnd it’s <strong>100% free!</strong> Download it today from the Chrome Web Store. And take it for a test drive!', 'success', '[\"4-x\"]', 809, NULL, '2023-11-25 04:17:13', NULL, 'Learn More', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Learn%20More', 'Download', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Download', 0, 0, '2023-10-18 15:26:08', '2023-12-05 17:39:23'),
(6, '654654be144f0', NULL, 'Black Friday’s Here 🛍: HUGE Sale [Up To 70% Off] + Giveaway!', '<img src=\"data:image/png;base64,\" />\r\n<br><br>\r\nOur biggest sale of the year is now live! <strong>Get up to 70% off AIOSEO</strong>, the world’s best WordPress SEO plugin. You’ll unlock <em>tons of new features</em> like <strong>Cornerstone Content</strong>, <strong>Search Statistics</strong>, an <strong>advanced robots.txt editor</strong> and more! \r\n<br><br>\r\nPLUS enter our giveaway to WIN an <strong>iPhone 15 Pro Max</strong> 📱and <strong>Apple Watch Ultra 2</strong> ⌚. No purchase is necessary to enter!', 'success', '[\"4-x\",\"lite\"]', 894, NULL, '2023-11-20 00:00:00', '2023-11-27 00:00:00', 'Enter Giveaway', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=bf2023-enter-giveaway-v4-lite', 'Claim Your Upgrade Discount', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=bf2023-claim-your-upgrade-discount-v4-lite', 0, 0, '2023-11-04 14:27:10', '2023-11-26 17:44:42');
