(8, '6557c3ceba26e', NULL, '[New] See the Index Status of Your URLs Inside WordPress with AIOSEO 4.5.0 🕵🏻', '<img src=\"data:image/png;base64,\" />\r\n\r\nEver wanted an easy way to know if your URLs have been indexed? Now you can with AIOSEO’s new <strong>Index Status feature</strong> in version 4.5.0.\r\n<br><br>\r\nYou can check your URL’s index status and other important URL information from <strong>right inside your WordPress dashboard</strong>.\r\n<br><br>\r\nUpdate now and get this game-changing addition in AIOSEO 4.5.0!', 'success', '[\"4-x\",\"lite\"]', 958, NULL, '2023-11-25 04:17:13', NULL, 'Learn More', 'https://aioseo.com/new-index-status-enhance-your-seo-visibility-by-ensuring-all-your-urls-are-indexed/?utm_source=WordPress&utm_campaign=index-status-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=index-status-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 0, '2023-11-17 19:49:34', '2023-12-05 17:39:23'),
(9, '657a045329cfb', NULL, 'Introducing Support For Additional Page Builders: WPBakery and Avada 🎉', '<img src=\"data:image/webp;base64,\" alt=\"\" class=\"wp-image-1019\" style=\"object-fit:cover\"/>\n\n<p>If your website is built using WPBakery or Avada, then you’ll be happy to know that <strong>AIOSEO 4.5.2</strong> was developed with love just for you! ❤️</p>\n\n<p>Now, you can use AIOSEO right inside your favorite website builder, making it easy to perform SEO tasks as you work on your posts or pages.</p>\n\n<p>Update AIOSEO to 4.5.2 and give your page builder that much-needed SEO superpower. 🦸🏼‍♀️</p>', 'success', '[\"4-x\",\"lite\"]', 1010, NULL, '2023-12-13 14:43:22', NULL, 'Learn More', 'https://aioseo.com/introducing-aioseo-support-for-additional-pagebuilders-wpbakery-and-avada/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-plugin-notification', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-plugin-notification', 0, 0, '2023-12-13 19:21:55', '2024-05-15 15:15:18'),
(10, '65a7ff57697a0', NULL, '[New] Boost Your Rankings with Our Author SEO (Google E-E-A-T) Addon ✍️', '<p>We’re excited to announce our latest SEO module in AIOSEO 4.5.4 — the Author SEO addon 🥳.</p>\n\n<p>This is a simple yet powerful module that enables you to demonstrate your expertise, experience, authority, and trustworthiness <strong>(E-E-A-T)</strong> to search engines and users.</p>\n\n<p>As a result, you’ll get <strong><em>better rankings</em></strong>, <strong><em>increase your traffic</em></strong>, and <strong><em>boost your conversions</em></strong>.</p>\n\n<p>So, go ahead and <strong><em>update to 4.5.4</em></strong> and give your site that much-needed boost.</p>', 'success', '[\"4-x\",\"lite\"]', 1030, NULL, '2024-01-16 19:39:13', NULL, 'Learn More', 'https://aioseo.com/introducing-author-seo-google-e-e-a-t-addon/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=author-seo-eeat-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=author-seo-eeat-v4-x-lite', 0, 0, '2024-01-17 16:24:55', '2024-05-15 15:15:18');
INSERT INTO `pg_aioseo_notifications` (`id`, `slug`, `addon`, `title`, `content`, `type`, `level`, `notification_id`, `notification_name`, `start`, `end`, `button1_label`, `button1_action`, `button2_label`, `button2_action`, `dismissed`, `new`, `created`, `updated`) VALUES
(11, '65b51d8f1f593', NULL, 'Winter Sale 2024 ❄️ Get Up to 70% Off AIOSEO!!!', '<img src=\"data:image/webp;base64,\" alt=\"\" class=\"wp-image-1039\"/>\n\n<p>Our Winter Sale is On 🥳. This is your chance to boost your SEO and save up to 70% on AIOSEO!&nbsp;</p>\n\n<p>Whether it’s a new purchase or an upgrade, you’ll unlock 🔓 <strong>POWERFUL FEATURES</strong> that will help you take your SEO game to the next level.</p>\n\n<p>Start the year off with a bang and save big!</p>', 'success', '[\"4-x\",\"lite\"]', 1035, NULL, '2024-01-26 18:20:28', '2024-02-02 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=winter-sale-v4-x-lite', NULL, NULL, 0, 0, '2024-01-27 15:13:19', '2024-02-01 15:07:45'),
(12, '65cb85d5b686b', NULL, '[NEW] Updated SEO Preview, Redirection Manager, Author SEO, and More', '<p>AIOSEO 4.5.6 is live, implementing many of your suggestions! 🥳</p>\n\n<p>🔎 Improved SEO Preview - To better match Google SERPs.<br>📆 Redirect Scheduler - Schedule seasonal redirects easily.<br>📂 Import Redirects from a CSV File - Add redirects in bulk.<br>🖋️ Improved Author SEO - Improvements to the E-E-A-T addon.</p>\n\n<p>AIOSEO 4.5.6 comes packed with many other improvements to the modules you already love.&nbsp;</p>\n\n<p>Update your plugin to version 4.5.6 NOW!</p>', 'success', '[\"4-x\",\"lite\"]', 1042, NULL, '2024-02-12 22:15:51', NULL, 'Learn More', 'https://aioseo.com/new-updated-seo-preview-redirection-manager-author-seo/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-456-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-456-v4-x-lite', 0, 0, '2024-02-13 15:08:05', '2024-05-15 15:15:18'),
(13, '65cb85d5b78f8', NULL, 'Be Our Valentine and Get Up To 70% Off! 💝', '<img src=\"data:image/webp;base64,\" alt=\"\" class=\"wp-image-1053\"/>\n\n<p>It’s Valentine’s Day, and love is in the air! ❤️</p>\n\n<p>Get up to <strong><em>70% off</em></strong> when you upgrade your plan TODAY ONLY!</p>\n\n<p>So, take advantage of our Valentine’s Day sale and get more power under your site’s hood TODAY!</p>', 'success', '[\"4-x\",\"lite\"]', 1049, NULL, '2024-02-14 00:00:00', '2024-02-16 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=valentines-2024-v4-x-lite', NULL, NULL, 0, 0, '2024-02-13 15:08:05', '2024-02-15 15:08:48'),
(14, '65f70a321545b', NULL, '🍀 Flash Sale: Get Up To 70% Off AIOSEO This St. Patrick\'s Day! 🍀', '<p><strong><em>Happy St. Patrick\'s Day!</em></strong> Today\'s your lucky day because we\'re celebrating with a flash sale that\'s too good to miss.</p>\n\n<p>Score <strong><em>up to 70% off</em></strong> when you upgrade your plan <strong>TODAY ONLY</strong>!</p>\n\n<p>With this deal, there\'s no need to chase down a leprechaun to find that pot of gold. 🍯 But hurry, like a rainbow, it will disappear before you know it!</p>', 'success', '[\"4-x\",\"lite\"]', 1061, NULL, '2024-03-17 00:00:00', '2024-03-19 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=st-patricks-day-sale-v4-x-lite', NULL, NULL, 0, 0, '2024-03-17 15:20:18', '2024-03-18 15:19:48'),
(15, '65fb074c179e4', NULL, '📣 [New] Query Arg Monitoring for Improved Crawling and Indexing', '<p>We’ve revamped the Crawl Cleanup module and added a <strong><em>NEW</em></strong> <strong>Query Arg Monitor</strong>. This game-changing feature gives you greater control of your query args, resulting in more efficient crawling and indexing.</p>\n\n<p>AIOSEO 4.5.8 comes packed with many other improvements to the modules you already love.&nbsp;</p>\n\n<p>Update your plugin to version 4.5.8 NOW!</p>', 'success', '[\"4-x\",\"lite\"]', 1058, NULL, '2024-03-19 19:37:40', NULL, 'Learn More', 'https://aioseo.com/new-query-arg-monitoring-for-improved-crawling-and-indexing/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-458-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-458-v4-x-lite', 0, 0, '2024-03-20 15:57:00', '2024-05-15 15:15:18'),
(16, '6617fb1b5082d', NULL, 'The AIOSEO Broken Link Checker 1.2.0 is live 🥳!', '<p>Now with 3 powerful new features to make broken link management much easier. Update and get:</p>\n\n<ul>\n<li>🔗 Unified URL UI Improvements</li>\n\n<li>✍️ Broken Links Highlighter</li>\n\n<li>⏪ AIOSEO Redirects Integration</li>\n</ul>\n\n<p>Check out our announcement post for more and upgrade today!</p>', 'success', '[\"4-x\",\"lite\"]', 1069, NULL, '2024-04-10 19:13:10', NULL, 'Learn More', 'https://aioseo.com/easier-broken-link-management-with-3-new-features/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-460-blc-120-v4-x-lite', 'Get Broken Link Checker', 'https://aioseo.com/pricing-broken-link-checker/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-460-blc-120-v4-x-lite', 0, 0, '2024-04-11 15:00:43', '2024-05-15 15:15:18'),
(17, '6627d8c8ef7f1', NULL, '🌸 Get up to 70% off AIOSEO this Spring! 🌸', '<p>Take advantage of our <strong><em>spring sale</em></strong> for AIOSEO Pro. <strong><em>Up to 70% off</em></strong> 🤯</p>\n\n<p>Amplify your online presence with advanced features that will transform your site into a dynamic, high-performing powerhouse, at a fraction of the cost!</p>\n\n<p>These massive discounts won\'t last long, so act now!</p>', 'success', '[\"4-x\",\"lite\"]', 1074, NULL, '2024-04-22 20:24:47', '2024-04-26 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=spring-sale-v4-x-lite', NULL, NULL, 0, 0, '2024-04-23 15:50:32', '2024-04-24 20:01:04'),
(18, '6644d186786a2', NULL, '[NEW] Easier Site Connection to Google Search Console and Automatic Sitemap Syncing 🚀', '<p>AIOSEO 4.6.2 is live 🥳!</p>\n\n<p>We’ve made it super easy to connect your site to <strong>Google Search Console</strong> — so simple that you don’t even need to mess with verification codes!</p>\n\n<p>We’ve also made sitemap management easy! Your sitemaps can now <strong><em>automatically sync with GSC</em></strong>. This means we\'ll make sure that Google knows about all the necessary sitemaps automatically!</p>\n\n<p>Check out our announcement post for more. 👇🏻👇🏻</p>', 'success', '[\"4-x\",\"lite\"]', 1080, NULL, '2024-05-14 12:43:31', NULL, 'Learn More', 'https://aioseo.com/easier-site-connection-to-google-search-console/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-462-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-462-v4-x-lite', 0, 0, '2024-05-15 15:15:18', '2024-05-15 15:15:18');
